webpackJsonp([1112459091749],{683:function(t,e){t.exports={data:{wordpressPost:{title:"Baldness, marathon running and lower back pain: Most read articles in April",content:'<p>&nbsp;</p>\n<p>The most-read article in April was Yamada and colleagues&#8217; analysis of male pattern baldness and coronary heart disease, which received widespread <a href="http://www.bbc.co.uk/news/health-22024015">press coverage</a>. Also popular was Küster <em>et al</em>&#8216;s study highlighting the dangers of consuming over the counter analgesics before running a marathon which was also <a href="http://www.guardian.co.uk/lifeandstyle/2013/apr/19/marathon-runners-health-painkillers-researchers">covered in the press in the run-up to the London marathon this month</a>. Other newly-published papers in the top ten include Lin <em>et al</em>&#8216;s study of lower back pain and Mahtani <em>et al</em>&#8216;s study on sport participation following the Olympics.</p>\n<table width="483" border="1" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td valign="top" width="50">Rank</td>\n<td valign="top" width="132">Author(s)</td>\n<td valign="top" width="301">Title</td>\n</tr>\n<tr>\n<td width="50">1</td>\n<td width="132">Yamada <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/cgi/content/full/3/4/e002537">Male pattern baldness and its association with coronary heart disease: a meta-analysis</a></td>\n</tr>\n<tr>\n<td width="50">2</td>\n<td width="132">Küster <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/4/e002090.full">Consumption of analgesics before a marathon and the incidence of cardiovascular, gastrointestinal and renal problems: a cohort study</a></td>\n</tr>\n<tr>\n<td width="50">3</td>\n<td width="132">Clar <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/2/5/e001007.full">Systematic review of SGLT2 receptor inhibitors in dual or triple therapy in type 2 diabetes</a></td>\n</tr>\n<tr>\n<td width="50">4</td>\n<td width="132">Bardsley <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/1/e002007.full">Is secondary preventive care improving? Observational study of 10-year trends in emergency admissions for conditions amenable to ambulatory care</a></td>\n</tr>\n<tr>\n<td width="50">5</td>\n<td width="132">Doyle <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/1/e001570.full">A systematic review of evidence on the links between patient experience and clinical safety and effectiveness</a></td>\n</tr>\n<tr>\n<td width="50">6</td>\n<td width="132">Lin <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/4/e002654.full">Disabling chronic low back pain as an iatrogenic disorder: a qualitative study in Aboriginal Australians</a></td>\n</tr>\n<tr>\n<td width="50">7</td>\n<td width="132">Mahtani <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/1/e002058.full">Can the London 2012 Olympics ‘inspire a generation’ to do more physical or sporting activities? An overview of systematic reviews</a></td>\n</tr>\n<tr>\n<td width="50">8</td>\n<td width="132">Katzmarzyk <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/2/4/e000828.full">Sedentary behaviour and life expectancy in the USA: a cause-deleted life table analysis</a></td>\n</tr>\n<tr>\n<td width="50">9</td>\n<td width="132">Ekstrom <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/4/e002688.full">Aspirin treatment and risk of first incident cardiovascular diseases in patients with type 2 diabetes: an observational study from the Swedish National Diabetes Register</a></td>\n</tr>\n<tr>\n<td width="50">10</td>\n<td width="132">Liao <em>et al</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/2/6/e001908.full">An analysis of the content and clinical implications of online advertisements for female genital cosmetic surgery</a></td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>Most read figures are based on pdf downloads and full text views. Abstract views are excluded.<!--TrendMD v2.4.3--></p>\n'},site:{siteMetadata:{title:"Gatsby Default Starter"}}},pathContext:{id:"b7aecc28-5968-5a74-923d-6854e9ce8f86"}}}});
